import React from 'react'

export default function GoalContainer(props) {

    const renderGoals = props.goalArr.map((goals, index) => {
        return <p key={goals.id}>{goals.name}</p>
    })

    // console.log(props)
    return (
        <div>
            <br></br>
            <strong>{props.categoryName}</strong>
            <p>{renderGoals}</p>
            <button>Edit</button>
            <button>Delete</button>
        </div>
    )
}
